import React from "react";

function LoginForm(props){

    return(
<div className="form">
           
           <h4>
               Login
           </h4>
          
           <label>Your Email</label>
           <br />
           <input type="email" />
           <label>Your Password</label>
           <br />
           <input type="password" />
           <br /><br />
           <button>Login</button>
            <br />
           <p onClick={()=>{
            props.chgForm()
           }}>Create new account</p>

       </div>

    );
}
export default LoginForm
